def calculate_fun_values(n: int) -> list[int]:
    """"""

    def f(n, r):
        return n * (2 + (n - 1) * r) // 2
    s = []
    n_sqrt = int(n ** 0.5)
    for i in range(1, n_sqrt + 1):
        if n % i == 0:
            r = i
            st = n // i
            s.append(f(st, r))
            if i * i != n:
                r = n // i
                st = n // r
                s.append(f(st, r))
    return sorted(s)
